import React, { useState } from "react";
import Icon from "react-native-vector-icons/AntDesign";
import Icon2 from "react-native-vector-icons/Feather" 
import { launchCamera, launchImageLibrary } from "react-native-image-picker";
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput } from "react-native";
import {  
   
} from "../componenets/fintech11Style"

export default function History({navigation}){
    return(
        <SafeAreaView style={styles.pendingContainer}>
            <ScrollView>
                <Text style={styles.defaultText}>Yo bro</Text>
            </ScrollView>
        </SafeAreaView>
)}

const styles= StyleSheet.create({
    pendingContainer: {
        backgroundColor: "#000",
        flex: 1,
        paddingTop: 25,
    },
    defaultText: {
        color: "#fff",
        textAlign: "center"
    }

})
